message:
feat: OhaHelper - Novas funcionalidades formatNumber, formatAccuracyDay, convertMillisToHours e convertWattsToKWH.

formatNumber - Recuperar uma número formatado conforme o decimalFormat;
formatAccuracyDay - Recuperar o percentual da precisão de um tempo sobre 24 horas;
convertMillisToHours - Converter milisegundos em horas;
convertWattsToKWH - Converter o total de Watts em Kwh.

feat: OhaHelper - Novos métodos getAmountDays, getDateBegin e getDateEnd.

getAmountDays - Recuperar a quantidade de dias entre duas datas;
getDateBegin -  Recuperar uma data reiniciando a hora;
getDateEnd - Recuperar uma data com a hora final do dia.
